                <Helmet>
                    <title>Immortal</title>
                </Helmet>
                
                <h1 className='font-suk text-emerald-300 text-6xl text-center'>Hey there I'm Ansh</h1>
                <p>I am a full stack developer.I have made many minecraft plugins,Discord Bots, Arduino Projects,Websites,etc.
                    <br/>My main languages are Python,Java and I have worked with MongoDB,SQL,etc.
                </p>
                <h1 className='font-quote text-white px-8 py-8 text-4xl'>"When life gives u 1000 bucks,
                    <br/>
                You spend the money on an Arduino Uno."
                <br/>
                -Ansh 
                </h1 >
            </div>
        );
    }
    
}
 
export default Counter;
